import React, {memo} from 'react';
import styled from 'styled-components';

const IndexContainer = styled.div`
    width:100%;

    .titleContainer{
        width:100%;
        height:350px;
        background-color: #F9F9F9;
    }
`;

const index = memo(() => {
    return (
        <IndexContainer>
            <div className='titleContainer'>
                <h1 className='title'>취업지원</h1>
                <p className='txt'>취업 준비생 여러분의 취업을 돕기위한 정책들을 확인해보세요.</p>
            </div>
        </IndexContainer>
    );
});

export default index;
